INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (1, 7, 1, 'Malone pages that use more complex layouts with portlets and fancy CSS are sometimes not getting properly reflowed after rendering.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (2, 8, 1, 'All ways of downloading firefox should provide complete install instructions. At present, they are only visible on the Release Notes page.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (3, 9, 1, 'User-Agent:       
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (4, 1, 1, 'Problem exists between chair and keyboard', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (5, 3, 1, 'We''ve seen something very similar on AIX with Gnome 2.6 when it is compiled with XFT support. It might be that the anti-aliasing is causing loopback devices to degrade, resulting in a loss of transparency at the system cache level and decoherence in the undelete function. This is only known to be a problem when the moon is gibbous.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (6, 4, 1, 'Sorry, it was SCO unix which appears to have the same bug. For a brief moment I was confused there, since so much code is known to have been copied from SCO into AIX.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (7, 5, 1, 'This would be a real killer feature. If there is already code to make it possible, why aren''t there tons of press announcements about the secuirty possibilities. Imagine - no more embarrassing emails for Mr Gates... everything they delete would actually disappear! I''m sure Redmond will switch over as soon as they hear about this. It''s not a bug, it''s a feature!', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (8, 6, 1, 'Oddly enough the bug system seems only capable of displaying the first two comments that are made against a bug. I wonder why that is? Lets have a few more decent legth comments in here so we can see what the spacing is like. Also, at some stage, we''ll need a few comments that get displayed in a fixed-width font, so we have a clue about code-in-bug-comments etc.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (9, 10, 1, 'Initial bug report.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (10, 11, 1, 'A test description', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (11, 12, 1, 'After you''ve installed a new plugin, you need to restart the browser. Does it work if you restart Firefox?', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (12, 13, 1, 'Maybe DMA isn''t enabled?', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (13, 14, 1, 'When I press print in Firefox, nothing happens, not even a print dialog comes up.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (14, 15, 1, 'Every time I start Thunderbird it crashes.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (15, 16, 1, 'Welcome to Canada!', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (16, 17, 1, 'test bug', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (17, 16, 2, 'Unicode™ text', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (18, 18, 1, 'XMMS has a plugin for that.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (19, 19, 1, 'Have you tried changing the preferences in system->preferences->preferred applications?', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (20, 20, 1, 'Hi, see https://help.ubuntu.com/community/Java for the proper way to install Java.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (21, 21, 1, 'Please refer to the RestrictedFormats wiki page (http://help.ubuntu.com/RestrictedFormats).
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (22, 22, 1, 'Problem is solved. Thanks very much. Firefox now works after the changes were made in system ->preferences', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (23, 23, 1, 'What plugin does that? And how can I install it?', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (24, 24, 1, 'I''ve had problems when switching from Jokosher to Totem to play an Ogg.
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (25, 25, 1, 'The solution to this is to make Jokosher use autoaudiosink which will respect gnome preferences) be default, and provide an option to override it.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (26, 26, 1, 'I''m not sure that autoaudiosink is in fact the best solution. We need a better UI to allow the user to select audio sinks for the system as a whole and for specific applications.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (27, 27, 1, 'Unfortunately, the lead developer of autoaudiosink has resigned and the project is dormant.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (28, 28, 1, 'The strangest thing should be happening here. My subject titles don''t show up! Why is that? Well, because there is no new information there.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (29, 29, 1, 'And so it should be displayed again.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (30, 30, 1, 'This title, however, is the same as the bug title and so it will be suppressed in the UI.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (31, 31, 1, 'When trying to copy, cut or delete just a selected portion of an event, the operations affect the event completely. That is, you can''t select a portion and cut that piece. The whole event will be cut. Same goes for the other 2 operations.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (32, 32, 1, '** Changed in: jokosher (upstream)
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (33, 33, 1, 'This is a very substantial amount of work, though. The whole event model will need to be aware of the selection of specific portions. This should really be specified in some detail and then implemented in a separate branch because it will certainly destabilise the tree for a long time.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (34, 34, 1, 'It would be a remarkable feat of engineering to do this before the 0.3 release. Lets target this for fixing before 1.0 though.', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (35, 35, 1, 'Does it make sense to mark it critical if it''s not going to be fixed for a year, though?', NULL, NULL);
INSERT INTO messagechunk (id, message, "sequence", content, blob, fti) VALUES (36, 36, 1, 'Yes, I think so, because that means it shows up near the top of our open bugs report and it really is a huge gaping omission.', NULL, NULL);
